INSERT INTO `posts` (`id`, `tieude`, `noidung`, `username`, `created_at`, `theloai`, `ghimbai`, `image`, `trangthai`, `tinhtrang`) VALUES
	(1, 'Tnh nng M L Cnh Thi Trang', '[left][color=#000000][size=20][font=Arial]- M ly s update thm vt phn mi : Cnh Thin Thanh , Cnh Ng Sc , Cnh Ha Tinh , Cnh Cu Vng\n-  m ly cnh thi trang cc bn cn v m ly cnh.\n- Nu may mn cc bn th m c vt phm vnh vin.[/font][/size][/color][/left]\n\n', 'chipdev', '2023-11-05 22:45:27', 0, 1, NULL, 0, 0),
	(2, 'Hng dn - Chc nng THU BO H [i bun]', '[color=#1e5b7e][size=15][font=Arial][b]Hng dn - Chc nng THU BO H [i bun][/b][/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][b]HIP S BO H[/b][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Mt thng nhn ch c thu 1 hip s bo h trong 1 chuyn bun.\n\n- Hip s c thu bo h phi ng gn thng nhn v vt bun , cng khu cng map\n\n- Ch c th thu c hip s bo h khi ang i bun v th vt bun\n\n- Thu bo h bng cch vo MENU CHC NNG -> KHC -> THU BO H[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643597441211.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Nhp tn nhn vt ca HIP S  mi[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643597446645.png[/img][/font][/size][/color][/center]\n\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643597444569.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- S ln bo h hip s l 3 ln, thi gian bo h Hip s l 30 giy cho mi ln s dng, c cng dn nu dng nhiu ln bo h.\n\n- Thng nhn bm vo con bun  hin th hip s bo h[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643598864778.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Sau mi ln hon thnh chuyn bun hoc ht gi i bun th s c reset ngi bo h[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:08:25', 0, 1, NULL, 0, 0),
	(3, 'Hng Dn - Lng Ph Sng', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Lng Ph Sng[/b][/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][b][color=red]Lng Ph Sng [CHNH THC][/color][/b][/font][/size][/color][/center]\n\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/16814583446682.png[/img][/font][/size][/color][/center]\n\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/16813767175663.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Game ra mt mt vng t mi c gi l Lng Ph Sng ,  vo c th ngi chi phi n NPC Oda  i n \n- Nhn vt phi c level 100 tr ln mi c th i vo\n-  i n map qui  tp luyn th phi c v bn  Beatrix  lng ph sng, ri n NPC SERENA  lng ph sng chn Vt lng ph sng\n- Vo map qui thnh cng th s tr 1 v vi thi gian l 4 gi up\n- Bn s c NPC a vo hon ton ngu nhin map [tng ng vi level nhn vt].\n\nC tng cng 10 map qui\nLevel 100-109 s c a vo map qui lv 100 v qui 105 [c 2 map]\nLevel 110-119 s c a vo map qui lv 110 v qui 115 [c 2 map]\nLevel 120-129 s c a vo map qui lv 120 v qui 125 [c 3 map]\nLevel 130-139 s c a vo map qui lv 130 v qui 135 [c 3 map]\n\n- Mt map ch ti a 20 ngi , khi map y s khng th vo thm c na\n- Nu ngi chi git nhau th s b a v lng ph sng ngay lp tc c ngi git v ngi b cht .\n- B qui cn cht cng s b a ngay v lng ph sng\n- nh qui  y s nhn c kinh nghim cao hn so vi map qui bnh thng, vt phm gi tr cng ri nhiu hn nh Lng cc loi , Xng , Trang b Tm/Cam kha , Mnh sch ghp ,  ha tinh , Nguyn t cho GIP SU TP , ph v lng , nl tinh t v.v cng nh khng c s quy nhiu ca CON MA\n- Up vng trn y khng b tnh ip\n- Ngoi ra c boss  vng t s xut hin  y  cc bn sn , c 8h ti sinh 1 ln mi map\n- Khi nhn vt offline m vn cn thi gian vt lng ph sng th khng b tnh\n- Pet Khng  st khng c p dng.[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:10:27', 0, 1, NULL, 0, 0),
	(4, 'Hng Dn - Chc nng CHIM M', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Chc nng CHIM M[/b][/font][/size][/color]\n[color=#000000][size=15][font=Arial]- Thi gian chim m s bt u vo lc 8h sng v 20h (8h ti) hng ngy, thi gian din ra cuc chin vn l 1 ting v gin cch 11 ting sau mi trn chin chim m.\n\nBn di y l danh sch tt c M ti nguyn  c cp nht trong game (nh vo khu vc 5), lu  l mt bang c th chim bao nhiu m cng c nn hy sp xp chin thut cho hp l nh:\n\n1 - Khu ba rng > m vng\n2 - Rng o gic > m kinh nghim\n3 - Thung lng k b > m ngc\n4 - H k c > m kinh nghim\n\n5 - B bin > m vng\n6 - Vc  > m vng (va fix li)\n7 - m ly > m kinh nghim\n8 - n c > m vng\n\n9 - Ca bin > m vng\n10 - i ct > m ngc\n11 - Vc ln > m kinh nghim\n12 - Ngha a ct > m vng\n\n13 - Sui ma > m kinh nghim\n14 - Thung lng  > m ngc\n\n15 - Rng cao nguyn > m vng\n16 - o hoang s > m ngc\n\nMt s im cn lu  khi bang hi chim M ti nguyn:\n- M ti nguyn ch c th chim c khi gi chin bt u.\n- Nu m ti nguyn c lng HP thp hn 50%, n s t ng kch hot c ch t hi mu lin tc cho n khi hi HP hon ton.\n- C mi ln m  b ph hy, ln hi sinh tip theo n s c lng HP nhiu hn.\n- Nu qui nhn bn cn tn ti, n s to ra php b tr khin M  c ch s phng th v khng bng vi ch s ca qui nhn bn.[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:11:43', 0, 1, NULL, 0, 0),
	(5, 'Hng Dn - Chc Nng THNH TCH', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Chc Nng THNH TCH[/b][/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][b][color=red]Thnh Tch[/color][/b][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- C 3 mc thnh tch trong game l i Gia , Triu Ph , T Ph.\n- Khi cc bn np 1 ngc s nhn ngay 1 im np ngc.\n- Khi cc bn dng 1 ngc vo chc nng bt k s nhn ngay 1 im dng ngc\n- Khi ngi chi  iu kin ca mc thnh tch c th n trc tip NPC Hammer/ Black Eye  nhn (nu vn cn s lng) . C ngy 1 hng thng reset li thnh tch v im .[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16230396023613.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- IM NP v IM DNG ch tnh[b][color=red]sau khi bo tr nh k ngy 1 hng thng[/color][/b]\n\n[b]- Lu  o chong ch m i vo lc 11h-11h30 mi ngy.\nLevel 40 tr ln mi c th i.[/b]\n[/font][/size][/color]\n[center][table][tr][td][color=#000000][size=15][font=Arial][color=#ffffff][b]Quyn li thnh tch[/b][/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#ffffff][b]Mc "i Gia"[/b][/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#ffffff][b]Mc "Triu Ph"[/b][/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#ffffff][b]Mc "T Ph"[/b][/color][/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]S lng[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#00BFFF]40 ngi[/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#00BFFF]20 ngi[/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#00BFFF]10 ngi[/color][/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]im np ti thiu[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]50 im[/font][/size][/color][/td]\n[td][color=#0