Min st thng in:[/b]c t l xy ra , khi xy ra th b qua st thng ny\r\n[b]- Gip bo h :[/b]xy ra khi b ngi khc nh, tn ti trong 10s, trong 10s nu b nh lin tip t 3 ln s gim st thng ca ngi nh i : 100% - 75% - 50%.\r\n[b]- Bc ph :[/b]khi b nh s c t l xy ra, to v n gay st thng random 10- 40% mu cho i th trong khong cch 6 .\r\n[b]- Hung tn :[/b]c t l xy ra , thi gian tn ti hiu ng 20s . Khi xy ra s ngu nhin yu cu ht nh , nh  ht yu cu l ht 3-5% max mu cho mnh. Nu vn cn thi gian tn ti th vn tip tc random li ht yu cn v vn s ht lng mu khi tha iu kin \r\n[b]- Chnh xc :[/b]c t l xy ra , khi nh k th xy ra dng ny gip gim i n trnh 90% ca k th.\r\n[b]- Gip bch kim :[/b]c t l xy ra , khi nh k th xy ra dng ny gip gim i ch mng ca k th i 90%.\r\n[b]- Gip thin s :[/b]c t l xy ra , khi nh i th xy ra dng ny th gim phn dame ca k th i 90%\r\n[b]- Gip v binh :[/b]c t l xy ra , khi bn b nh , nu hiu ng xy ra th gim xuyn gip ca k th i 90%.\r\n[b]- Ngu n :[/b]Tc dng lm con Pet ca k th b mt tc dng trong thi gian 30 giy.\r\n[b]- Bt t :[/b]Khi b k th nh ,lng mu sau st thng  nu ri vo <= 5% max mu th bt t s xut hin trong 5s. Bn s c bt t trong n nh  . Trong thi gian  , st thng khi nh ngi khc = 0, c thi gian cooldowwn gia cc ln.\r\n[b]- M mt :[/b]Khi nh i th lm cho i th b m mt trong 5s, c t l xy ra, khi m mt th nh skill s ht.\r\n[b]- Thiu chy :[/b]Khi b nh , v mu cn <= 30% s xy ra , thi gian tn ti 20s, c sau 3s l s tr 5000 mu cho ai ng gn, c thi gian cooldown.\r\n[b]- Tn ph :[/b]Khi nh i th, xy ra s tr Mp i th cn 1%, cm hi Mp trn trang b trong vng 5s.\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red]M mua bn  tinh t[/color][/b][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15985225712280.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Tt c  tinh t trng , xanh dng , vng , tm , cam s treo bn bnh thng nh nhng trang b khc  trn khu mua bn. Y nh bn trang b m thi , khng c g c bit thay i.\r\n\r\n- i vi  tinh t trng , xanh dng , vng , tm , cam m [KHA] th cho mua bn trn khu mua bn c bit v vn cn cc th ng , bc , vng ng loi  gia 2 bn mua/bn . Y nh bn trang b KHA m thi , khng c g c bit thay i\r\n\r\n- i vi  tinh t xanh l , ch c th treo bn khi c ng tinh t[img]http://my.teamobi.com/app/view/forum/15985225712869.gif[/img]m thi , kha hay khng th bn bn v mua cng cn ng tinh t mi c th mua bn cho nhau.\r\n\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red]M tch  tinh t[/color][/b][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15985225715890.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n\r\n- Cho tch  tinh t xanh dng , vng , tm , cam . T l tch  tinh t cc k cao\r\n- T l tch  tinh t khng ph thuc vo ch s cng , bt c level no cng no cng c th tch[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:12:40', 0, 1, NULL, 0, 0),
	(7, 'Hng Dn - Chc Nng CH TO M AY', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Chc Nng CH TO M AY[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red][font=verdana]M ay[/font][/color][/b][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682107082673.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n Ch to M ay[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682084944073.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Cc hip s phi thu gom cc nguyn liu yu cu\r\n- C loi s ri ra khi tiu dit qui +- 5 level so vi nhn vt , mi qui vt khc nhau s ri ra cc nguyn liu to M ay cp 1 khc nhau - bao gm c Boss , v c qui trong ph bn\r\n- C loi s ch c trong chin trng khi tiu dit Boss - nh chnh - qui trong map chin trng[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682085429119.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n 5 nguyn liu cp 1 -> 1 nguyn liu cp 2\r\n 5 nguyn liu cp 2 -> 1 nguyn liu cp 3\r\n- Khi c nguyn liu cp 3 , cc hip s c th tin hnh ch to M ay\r\n Nng Cp M ay\r\n- Khi ch to mt M ay , cc hip s c th bit c s dng n c th c\r\n- Khi +9 ca M ay  , tt c cc dng n s c m ht.[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682085423314.png[/img][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682084943228.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial][color=blue][i]Lu \r\n- Cc hip s c th s dng M ay khc phi\r\n- M ay khi s dng s trang b th 2 . Bm vo  v kh  c th chuyn sang trang b th 2 hoc gp NPC Hammer  tho M ay\r\n- M ay s lun thay i nguyn liu yu cu mi khi bn ch to xong 1 ci\r\n- M ay cng s i nl khi t cc mc nng cp\r\n[/i][/color][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=blue][i][img]http://forum.knightageonline.com/app/view/forum/14682085428560.png[/img][/i][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial][color=blue][i]\r\n- Cc nguyn liu ch to M ay c th mua bn trn khu mua bn[/i][/color][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red][font=verdana]Khu mua bn[/font][/color][/b][/font][/size][/color][/center]\r\n\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682223084709.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[b][color=red]Mt s thay i v M ay[/color][/b]\r\n- Cng vi vic thay i dng st thng , cc hip s c thay i lun c % dng st thng trn m ay cho tht ph hp vi m ay . Nu m ay c hn 1 dng tng % st thng th khi i h thng s random 1 trong nhng dng  i\r\n- M ay c th nng cp n +15\r\n- Ngoi ra m ay cn c th c l v khm ngc nguyn thy [ ch khm c ngc ny ]\r\n- Ngc Nguyn Thy c th nht c khi cc bn o ngc  cc Map ngc khm mi\r\n\r\n[b][color=red]Chc nng ng/ M ri nguyn liu m ay[/color][/b]\r\n\r\n- Chc nng hon ton min ph\r\n- Nu cc bn khng mun nh qui nht t ng m nht nguyn liu lm full hnh trang , hy chn ng ri nguyn liu m ay th tt c nguyn liu s khng ri na ,m  khng ri th s khng nht c lm full\r\n- Nu cc bn mun nguyn liu m ay ri li hy chn M ri nguyn liu m ay th s ri li bnh thng khi nh qui.\r\n- Hy nh M ri nguyn liu m ay khi Ph bn , sn Boss , hay chin trng nh , nu cc bn mun nht NL vng, tm nh .\r\n- Khi thot game vo li , h thng s mc nh li l M ri nguyn liu m ay, nn nh kch hot li nh.\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red]Tc dng c bit ca dng n M ay[/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n-[b]Khin ma thut[/b]: Gim 50% st nu qu 10% mu hin ti\r\n\r\n-[b]Bng lnh[/b]gy mt A% mp trong B giy. Ti a s mp mt trong mi giy l 8%.\r\n\r\n-[b]Bng la[/b]: gy mt A% mu trong B giy. Ti a s mu mt trong mi giy l 8%\r\n\r\n-[b]Gip hc m[/b]: chuyn 1 phn st thng ca i th thnh gip\r\n\r\n-[b]Tng hnh[/b]: tng hnh trong 1 khong thi gian nht nh , vn thi trin c skill\r\n\r\n-[b]L ln[/b]: Lm cho i phng khng th tn cng v mt phng hng di chuyn[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:13:17', 0, 1, NULL, 0, 0),
	(8, 'Tc dng ca cc dng n c bit M ay', '[color=#1e5b7e][size=15][font=Arial][b]Tc dng ca cc dng n c bit M ay.[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red]Tc dng c bit ca dng n M ay[/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n-[b]Khin ma thut[/b]: Gim 50% st nu qu 10% mu hin ti\r\n\r\n-[b]Bng lnh[/b]gy mt A% mp trong B giy. Ti a s mp mt trong mi giy l 8%.\r\n\r\n-[b]Bng la[/b]: gy mt A% mu trong B giy. Ti a s mu mt trong mi giy l 8%\r\n\r\n-[b]Gip hc m[/b]: chuyn 1 phn st thng ca i th thnh gip\r\n\r\n-[b]Tng hnh[/b]: tng hnh trong 1 khong thi gian nht nh , vn thi trin c skill\r\n\r\n-[b]L ln[/b]: Lm cho i phng khng th tn cng v mt phng hng di chuyn[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:13:37', 0, 1, NULL, 0, 0),
	(9, 'Hng Dn - Chc Nng VNG XOAY MAY MN', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Chc Nng VNG XOAY MAY MN[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14600235348997.png[/img][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/1460023045368.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[color=red][b]- Lut chi:[/b][/color]\r\n\r\n- Ti NPC Cp Bin s c Vng quay thng v Vng quay Vip\r\n\r\nGi tr nhp vng ca mi ngi  Vng quay thng t 10.000 - 100.000 vng\r\n\r\nGi tr nhp vng ca mi ngi  Vng quay Vip t 1.000.000 - 50.000.000 vng\r\n\r\n tham gia Vng quay Vip bn phi s hu trn 5.000.000 vng\r\n\r\nMi ngi chi ch c php nhp vng 1 ln/ 1 lt quay.\r\n\r\nVng quay s bt u khi c 2 ngi chi tr ln. Sau 2 pht th s c kt qu ngi chi may mn.\r\n\r\nCn 10 giy cui s kha khng th tham gia.\r\n\r\nNgi chin thng s nhn ht tng s tin tt c ngi chi khc t cc sau khi  tr thu.\r\n\r\nThu s l 10%.\r\n\r\nNgi c vng trn ln hn 1 t s khng th tham gia vng quay may mn.\r\n\r\n[color=red][b]- Bng thng tin:[/b][/color]\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14600230458918.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\nThi gian: 2:00 - Thi gian vng quay cn 2 pht 00 giy na s bt u. y l thi gian hin ti ca vng quay lc bn chn Menu thng tin.\r\n\r\nTng s: 10.000.000 - y l tng s vng ca tt c ngi chi ngay ti lt quay  tnh ti thi im .\r\n\r\nT l thng :100%\r\n\r\n- Ty thuc vo s vng bn tham gia v tng s vng trong lt quay m bn s c t l thng khc nhau. T l thng ca bn s thay i lin tc khi c ngi chi tham gia vo.\r\n\r\nNgi va chin thng: vampirecat - ngi va chin thng  lt quay trc .\r\n\r\nS vng thng: 98.980.000 - S vng nhn c khi chin thng.\r\n\r\nS vng tham gia: 5.000.000 - S vng tham gia vo lt quay .[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:13:58', 0, 1, NULL, 0, 0),
	(10, 'Hng dn - Chc nng LI I', '[color=#1e5b7e][size=15][font=Arial][b]Hng dn - Chc nng LI I[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]https://scontent.fsgn4-1.fna.fbcdn.net/v/t1.18169-9/23795097_786349891566873_764743553125591765_n.png?stp=dst-png_p526x395&_nc_cat=101&ccb=1-7&_nc_sid=730e14&_nc_ohc=wdG8l0yQzncAX-DD8Mg&_nc_ht=scontent.fsgn4-1.fna&oh=00_AfA8AflysQ-ws0sFLRC1B9u1fMt83ZeL_H_J_JmC3gmjPg&oe=64A8B25C[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n[b]ng k[/b]\r\n- ng k tham gia ti Npc Miss Oda. Level t 60 tr ln mi c tham gia li i.\r\n- Thi gian chy li i s l 18h30.\r\n- Ph ng k l 5 ngc cho 1 ln ( 14 ngy )\r\n\r\n[b]Ni dung chi tit[/b]\r\n- Mi my ch s chia cp da theo s im li i ca ngi chi\r\n- Li i din ra 10 vng ( trn) u, mi vng ( trn ) cch nhau 2 pht ch\r\n- Mt vng ( trn ) u s din ra trong vng 5 pht, gm 3 hip :\r\n Thng 1 hip m ht gi th xem nh l thng chung cuc\r\n Mi ngi thng 1 hip m ht gi th ha\r\n\r\n[b]Khn gi[/b]\r\n- Ngi chi khc mun vo xem hay c v cc trn u th n gp Npc Oda.\r\n\r\n[b]Cch tnh im nh sau :[/b]\r\n==> Nu hai i th bng im nhau, ngi no thng th + 30 im , ngi thua b -30\r\n\r\n==> Ngi c im li i cao hn thng th im = 30 - ( con s chnh lch im li i ca 2 ngi . MAX chnh lch l 15 im )\r\n[i]v d : A c 100 im thng B c 70 im li i trn u th A c +15 im , cn B b -15 im[/i]\r\n\r\n==> Ngi c im li i thp hn thng th im = 30 + ( con s chnh lch im li i ca 2 ngi )\r\n[i]v d : C c 100 im thng D c 150 im li i trn u th C c +45 im , cn D b -45 im[/i]\r\n\r\n[b]i danh hiu[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/15126386526418.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n+ Danh hiu i hip s, tng tng vi im li i >= 2520. Cng thc i VNG = IM LI I x5.000. Ti a rng vng nhn c : 10\r\n+ Danh hiu Hip s tng ng vi im li i < 2520 v >= 1680. Cng thc i VNG = IM LI I x4.000. Ti a rng vng nhn c : 5\r\n+ Danh hiu Hip s nh tng ng vi im li i < 1680 v >= 1260. Cng thc i VNG = IM LI I x1.000 . Ti a rng vng nhn c : 3\r\n+ Danh hiu Hip s tp s tng ng vi im li i < 1260 v >= 840. Cng thc i VNG = IM LI I x800 . Ti a rng vng nhn c : 2\r\n+ Danh hiu Lnh canh tng ng vi im li i < 840 . Cng thc i VNG = IM LI I x500 . Ti a rng vng nhn c : 1\r\n\r\n- y l quy nh iu chnh thay i mi nht thay cho thng bo ngy 3/8.\r\n- Khi i qu , Danh Hiu s c set cho nhn vt , ton b im s reset li\r\n\r\n\r\n[b][color=red]Chia nhm li i nh sau :[/color][/b]\r\n+ Nhm 1 : t level 60 n 74\r\n+ Nhm 2 : t level 75 n 84\r\n+ Nhm 3 : t level 85 n 94\r\n+ Nhm 4 : t level 95 n 104\r\n+ Nhm 5 : t level 105 n 114\r\n+ Nhm 6 : t level 115 n 124\r\n+ Nhm 7 : t level 125 tr ln\r\n[b]V l do nhm 8 qu level 135 tr i qu t nn s gp vo nh cng nhm 7[/b]\r\n\r\n[b][color=red]Qu cho top nhm li i nh sau :[/color][/b]\r\n[b]- Top 1 nhm 1 n nhm 4 s c phn qu sau :[/b]\r\n Top 1 : 3  3 mu , 10 lng ( ngu nhin xanh -  - vng ) , 10 xng , 1 ng Tyche, 1 ng Horae , 1  Krypton cp 1[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/15270669162523.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n Top 2 : 5 lng ( ngu nhin xanh -  - vng ) , 5 xng , 1 ng Tyche, 1 ng Horae\r\n Top 3 : 3 lng ( ngu nhin xanh -  - vng ) , 3 xng , 1 ng Horae\r\n\r\n[b]- Top 1 nhm 5 n nhm 7 s c phn qu sau :[/b]\r\n Top 1 : 3  3 mu , 1 sch skill ( ngu nhin class ), 1 ng Tyche, 1 ng Horae , 1 sch tri thc , 1  Krypton cp 1 ,[b]thm 5 nguyn liu tinh t bt k , ngu nhin 1 la tinh t[/b]\r\n Top 2 : 2  3 mu , 1 ng Tyche, 1 ng Horae , 1 sch tri thc,[b]thm 3 nguyn liu tinh t bt k , ngu nhin 1 la tinh t[/b]\r\n Top 3 : 1  3 mu , 1 ng Tyche, 1 ng Horae , 1 sch tri thc,[b]thm 2 nguyn liu tinh t bt k , ngu nhin 1 la tinh t[/b]\r\n\r\n- Khi i qu, ton b im s reset li\r\n\r\n[b]- Thng Bo[/b]\r\n- 10 ngi thuc top danh vng khi u Li i s c thng bo\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]1 S Thay i v Li i [ p dng t 24.1.2019][/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n-  to ng lc cho cc bn tham gia :\r\n- K t lc cc bn tham gia li i , nu s im cc bn kim c < 1260 ( t mc Hip s tp s ) s khng b tr im khi nh thua. T >= 1260 tr i vn tnh tr im bnh thng . Thng vn tnh im bnh thng\r\n[b]- Qu cho thi u li i s c 1 s thay i nh sau :[/b]\r\n- Qu Top khng thay i , tuy nhin  lt top cc bn phi >=[b]800[/b], nu nhm  khng c ai > s im ny th coi nh l khng c TOP\r\n+ Khi t Danh hiu i hip s, tng tng vi im li i >= 2520. Cc bn s c tng thm 1 Rng Thn K\r\n+ Khi t Danh hiu Hip s tng ng vi im li i < 2520 v >= 1680. Cc bn s c tng thm 1 Rng Ma Thut\r\n+ Khi t Danh hiu Hip s nh tng ng vi im li i < 1680 v >= 1260. Cc bn s c tng thm 1 Rng Huyn Thoi.\r\n\r\n- Ngoi ra , c 200 im cc bn s c 1 rng vng. V d : lovvvve t c 2145 im th s nhn c 10 rng vng ( ti a rng nhn c l 10)\r\n\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]1 S Thay i v Li i [ p dng t 1/10/2020][/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\niu chnh li lut li i . Tnh t ma mi\r\n- Khi cc bn tt level nh th no , th h thng vn chia nhm cc bn vo nhm ng vi level cao nht cc bn t c [p dng t by gi 1/10/2020 thi nh , trc ngy  tt level th khng tnh]\r\n\r\n- V d t sau ngy 1/10/2020\r\nbn level 95 dng bin d v level 94 th khi ng k li i cc bn vn thuc nhm 3 [t level 85 n 94] sau  nu ln li level 95 th d c tt vn l ma sau nhm 4[t level 95 - 104]\r\n\r\n\r\n- Bt u t ma mi tr i , ng k li i s khng thay i nh thng bo ngy 3/8.\r\n- Nhng t ma mi i vng li i s iu chnh vng i qu nh sau :\r\n\r\n+ Danh hiu i hip s, tng tng vi im li i >= 2520. Cng thc i VNG = IM LI I x5.000. Ti a rng vng nhn c : 10\r\n+ Danh hiu Hip s tng ng vi im li i < 2520 v >= 1680. Cng thc i VNG = IM LI I x4.000. Ti a rng vng nhn c : 5\r\n+ Danh hiu Hip s nh tng ng vi im li i < 1680 v >= 1260. Cng thc i VNG = IM LI I x1.000 . Ti a rng vng nhn c : 3\r\n+ Danh hiu Hip s tp s tng ng vi im li i < 1260 v >= 840. Cng thc i VNG = IM LI I x800 . Ti a rng vng nhn c : 2\r\n+ Danh hiu Lnh canh tng ng vi im li i < 840 . Cng thc i VNG = IM LI I x500 . Ti a rng vng nhn c : 1[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:14:26', 0, 1, NULL, 0, 0),
	(11, 'Hng Dn - Ngc Khm Mi', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Ngc Khm Mi[/b][/font][/size][/color]\r\n[color=#000000][size=15][font=Arial]- Ti NPC Lisa s c cc v  vo khu vc o ngc , mi khu vc m khc nhau s c nhng ngc khc nhau. Level 30 mi c vo khu m. Bm s dng v  n khu m[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15057310688853.png[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15057310682814.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]- Mi ln vo m l s tn 1 v, nu cc bn mun ra khi khu m c th gp NPC Anwen[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15057310686361.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Mi loi ngc s ch c th khm vo 1 s trang b nht nh\r\n Ngc Hn Nguyn v Ngc Khi Hon ch c th khm vo v kh[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15058822428067.jpg[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15058823025418.jpg[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n Ngc Lc Bo v Ngc Phong Ma ch c th khm vo trang phc : qun, o , nn , giy , gng tay[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15058822427433.jpg[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15058822429793.jpg[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n Ngc Sinh Mnh v Ngc Tm Linh ch c th khm vo trang sc: nhn , dy chuyn[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/1505882302956.jpg[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15058823026650.jpg[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[b]Lu  :[/b]\r\n-  khm c ngc th trang b phi c l ,  to l th cc bn c th mua c Huyn b  c l.\r\n- Mi ln khm ch c khm 1 vin/ 1 ln, khm khng thnh cng s b mt ngc.\r\n- Ngc cp 1 v ngc cp 2 , cp 3 c th mua bn v giao dch trn khu mua bn.\r\n- Qui trong khu m th nh 10 hit s cht , khng c HP\r\n- Ngc o s l ngc cp 1 , cc bn c th p ln cp cao hn v max l ngc cp 5\r\n- Ngc cp cng cao th cng gi tr . Tuy nhin ty ngc m cc bn khm s lng cho hp l nh\r\n-  tho ngc khm cc bn vo NPC Oda, lu  cn phi s dng vt phm  mi c th tho ngc\r\n\r\nv d\r\nngc cp 1 hi mu 1% , th cp 5 hi mu 10%\r\nngc cp 1 25 hit nh mi c xut hin tc dng th ngc cp 5 l 5 hit s xut hin tc dng\r\n\r\n[b][color=red]Mt s thay i v Ngc Khm mi[/color][/b]\r\n- Tinh luyn ngc khm mi , chn loi ngc mun tinh luyn trong hnh trang, nhn s dng, ph mi vin t cp 1 ti cp 5 l : 1tr- 2tr-3tr-4tr-5tr vng\r\n- Ch nhng ngc no c bt li mi c th tinh luyn nh ngc lc bo , ngc sinh mnh , ngc hn nguyn , ngc khi hon\r\n-  tho ngc khm mn khc class , cc bn c th dng nt KHC  tho.[/font][/size][/color]\r\n\r\n[color=#000000][size=15][font=Arial][b][color=red]ngc hn nguyn cp 1 :[/color][/b]Khm v v kh, khi nh trng 25 hit ln [ngi khc, boss] s c x2 st thng, gim 50% Hp, tn ti trong 3 giy\r\n====> hi sinh 50% mu ca mnh  x2 dame ln ch khng phi gim 50% hp ca i th. Trong vng 3s  tt c hit ca bn nh ra u x2 nhng tr 1 ln 50% cho 3 giy huy hong .\r\nCch tinh hit ca ngc ny cng n gin . V d : cc bn khm 3 vin ln lt l :\r\n1 vin cp 1 l 25 hit\r\n1 vin cp 3 l 15 hit\r\n1 vin cp 4 l 10 hit\r\n-->theo cng thc trung bnh cng th tng s hit cui cng bng (25+15+10) / 3 = 16 hit\r\n\r\n[b][color=red]- ngc khi hon cp 1 :[/color][/b]Khm v v kh. Khi b nh trng 25 hit s khng tt c cc loi hiu ng ln nhn vt, b gim t l n trnh, ch mng, phm am, xuyn gip i 20%, tn ti trong 3 giy . Lu  : i th  y tnh ht qui , boss , ngi chi , cp my , lnh canh .....\r\n====> hiu ng  y tc l : tri chn , chong , ng bng , ru ng , bng lnh , l ln , bng la , vt thng su ......[b]C BOSS ln i th U KHNG[/b]\r\n\r\n[b][color=red]- ngc phong ma cp 1 :[/color][/b]Khi hp < 20% s c kh nng xy ra sau mi ln tn cng, hi 1% hp sau mi nht nh, tn ti trong 3 giy, t l 0.5%\r\n====>Tc l khi mu ca bn ch cn 20% so vi thanh mu th ngc ny s pht huy tc dng , bm 1% trong mi ln nh. Khm nhiu th iu kin <20% s tng ln v t l hi 1% cng cao ln .\r\nLng mu yu cu  c th xy ra l trung bnh cng\r\nlng mu c cng : trung bnh cng\r\nT l xy ra : Cng dn\r\n\r\n[b][color=red]- ngc lc bo cp 1 :[/color][/b]Chuyn 10% st thng ca i th thnh mu cho mnh , khng hi hp trong thi gian ny. Tn li trong 3 giy , t l xut hin %\r\n====> Nu bn khm nhiu hn th t l chuyn ha vn l 10% , ch tng t l % xut hin.V d nh trong vng 3 giy hiu ng i th nh bn c 2 skill th bn s c hng 10% skill 1 + 10% skill 2 . Lu  : i th  y tnh ht qui , boss , ngi chi , cp my , lnh canh .....\r\n- i ct : khi hon , sinh mnh\r\n- hang ng : tm linh , phong ma\r\n- tho nguyn : hn nguyn , lc bo\r\n- i c : khi hon , lc bo [/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:15:08', 0, 1, NULL, 0, 0),
	(12, 'Hng dn - Chc nng TH CI', '[color=#1e5b7e][size=15][font=Arial][b]Hng dn - Chc nng TH CI[/b][/font][/size][/color]\r\n[color=#000000][size=15][font=Arial][b]Th ci[/b]\r\n\r\n- y l chc nng dnh cho Bang Hi\r\n-  c Th ci Si Xm , Th Lnh c th mua ti shop Bang Hi cho cc thnh vin trong bang u c th xi c[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14779057631493.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Sau khi mua , th ci s nm ngay trong Kho Bang , cc thnh vin ch cn li NPC Zoro  s dng Si Xm[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14779057631336.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Khi ci Si Xm m b git hay thot game vo li vn ci Si Xm . Khi tho l mt ch khng nm trong hnh trang c nhn .\r\n- Nu cc hip s khng mun ci c th tho Th ci Si Xm ti NPC Hammer hoc Alisama , v nu mun s dng th c vo Kho Bang\r\n- Cc hip s ri bang th mt th ci Si Xm\r\n- Bang hi  c thm th ci mi khc cho cc th lnh chn la cho bang ca mnh[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16386090557591.png[/img][/font][/size][/color][/center]\r\n', 'chipdev', '2023-11-05 23:15:25', 0, 1, NULL, 0, 0),
	(13, 'Hng Dn - Chc nng BANG HI', '[color=#1e5b7e][size=15][font=Arial][b]Hng Dn - Chc nng BANG HI[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Cnh Thi Trang BANG HI[/b][/color][/font][/size][/color][/center]\r\n\r\n\r\n[center][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n-  c th mua cnh thi trang cc bn cn  tin trong qu bang v v mua cnh thi trang bang\r\n- V mua cnh thi trang bang hi c th kim trong chim m , khi cc bn nh sp m th s c kh nng nht c vt phm ny\r\n- V c th mua bn nn cc bn c th chuyn cho th lnh\r\n\r\n[b]Lu : Tt c cnh thi trang c dng khng tng exp ch tnh khi nh qui , m qu c exp . Khng p dng cho thu hoch m , nh cp[/b]\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Boss Bang Hi[/b][/color][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16430766984715.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Bang level t 40  ln c mua Ba gi boss.\r\n- Ch Th Lnh mi c gi boss ln nh\r\n- Boss bang ch nh ngi ca bang  v ch ngi bang  mi nh c Boss\r\n- 1 khu ch c 1 bang c gi boss\r\n- Khi cn boss bang th khng gi tip c.\r\n- Sau khi git boss bang th bang c gi tip sau 6 ting. Boss Bang sng 6 ting nu khng ai git s t cht\r\n- Qu ca Boss Bang :\r\nLng xanh\r\nLng \r\nLng vng\r\nC 4 l\r\n 3 mu\r\nTrang b cam\r\ni g\r\nng bc Tyche\r\n ha tinh\r\nKim loi v tr\r\nThi titan\r\nHi sinh ti ch\r\n may mn\r\nV x2 i bun\r\nMy\r\nThnh gi\r\nNgu nhin 1 item vng/tm KHA\r\nLa tinh t\r\nPh v lng\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]1 S Thay i v boss bang [ p dng t 27/5/2022[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Sau khi git boss bang th bang c gi tip sau 3 ting. Boss Bang sng 3 ting nu khng ai git s t cht\r\n- Tng s lng nl tinh t trong qu boss bang , tng t l ra  xn boss bang[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:16:03', 0, 1, NULL, 0, 0),
	(15, 'Danh sch SCAM LA O nn kim tra trc khi giao dch', '\n[color=#212529][size=20][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"][i][color=#e60000]Mi giao dch la o u b nghim cp ti Server Hip S Gold, nhng ngi chi cung cp thng tin SCAMMER( NGI LA O ) u s nhn c code t chng mnh. Cm n mi ngi  xem v cng chng mnh to mi trng chi game lnh mnh nh[/color][/i][/font][/size][/color]\n\n[color=#212529][size=15][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"][b][color=#6b24b2]THNG BO: HIN TI  MI BOX ZALO U S C GIAO DCH VIN (KEY BC), CC BN NN GIAO DCH TRUNG GIAN QUA CC GDV NY  TRNH LA O NH[/color][/b][/font][/size][/color]\n[b][color=#212529][size=15][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"]DI Y L DANH SCH LA O, GP L BLOCK KHNG NI NHIU[/font][/size][/color][/b]\n[b]Ai La o bn mnh s list li cho anh em  phng trnh nh[/b]\n\n[b][color=#6b24b2][size=15][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"]THNG BO: HIN TI  MI BOX ZALO U S C GIAO DCH VIN (KEY BC), CC BN NN GIAO DCH TRUNG GIAN QUA CC GDV NY  TRNH LA O NH[/font][/size][/color] [/b]', 'chipdev', '2023-11-05 23:30:32', 0, 1, NULL, 0, 0);
